text:'{"blocks":[{"key":"3sz49f","text":"聡明で、恐れ知らずで、止まることを知らない——バーバラ・ゴードンはバットガール。ゴッサム市警察本部長の娘であるバーバラは、影から抜け出し、自分自身のやり方で犯罪に立ち向かいます。鋭い機転、ハイテクなガジェット、そして卓越した武術スキルを武器に、彼女はバットガールとして街をパトロールし、何度も「ヒーローになるのに超能力はいらない」ことを証明してきました。悪党との戦いや、ゴッサムの裏社会の闇へのハッキングを通じて、バットガールは知恵と情熱、そして揺るがぬ決意で正義を貫きます。","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":238,"style":"hlnk:"},{"offset":21,"length":2,"style":"fontFamily:\\"Times New Roman\\""},{"offset":0,"length":238,"style":"overridden:true"},{"offset":0,"length":238,"style":"hlnkt:wp"},{"offset":0,"length":238,"style":"textOutlineEnable:false"},{"offset":0,"length":238,"style":"opacity:1"},{"offset":0,"length":238,"style":"hlnke:true"},{"offset":0,"length":238,"style":"backgroundColor:unset"},{"offset":0,"length":21,"style":"fontFamily:\\"MS Mincho\\""},{"offset":23,"length":215,"style":"fontFamily:\\"MS Mincho\\""},{"offset":0,"length":238,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":238,"style":"textHighlightEnable:false"},{"offset":0,"length":238,"style":"textShadowEnable:false"}],"entityRanges":[],"data":{"presetId":"text-body-1","listColor":"#666666","listType":"S_Bullets08","listSize":"100%","listIndent":"100%","listDepth":"0","overridden":"true"}}],"entityMap":{}}',
