text:'{"blocks":[{"key":"rek0x8","text":"静かにして、致命的。そして、贖われた存在。キャサンドラ・カインは、生まれたときから世界最強の暗殺者となるよう育てられ、言葉ではなく身体の動きを読み取り、ためらいなく殺す訓練を受けてきました。しかし、彼女はその運命に背を向け、新たな道を選び、バットガールとしての新たな自分を見出しました。比類なき武術の腕前と重い過去を背負いながら、キャサンドラは影からゴッサムを守ります。彼女の沈黙は、言葉以上に雄弁です。彼女はただの戦士ではありません——キャサンドラ・カインは「やり直すことができる」という希望の象徴であり、自分自身の未来のために戦う意味を体現する存在なのです。","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":281,"style":"overridden:true"},{"offset":0,"length":281,"style":"hlnkt:wp"},{"offset":0,"length":281,"style":"textOutlineEnable:false"},{"offset":0,"length":281,"style":"opacity:1"},{"offset":0,"length":281,"style":"hlnke:true"},{"offset":0,"length":281,"style":"backgroundColor:unset"},{"offset":0,"length":217,"style":"fontFamily:\\"MS Mincho\\""},{"offset":219,"length":62,"style":"fontFamily:\\"MS Mincho\\""},{"offset":0,"length":281,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":281,"style":"textHighlightEnable:false"},{"offset":0,"length":281,"style":"textShadowEnable:false"},{"offset":0,"length":281,"style":"hlnk:"},{"offset":217,"length":2,"style":"fontFamily:\\"Times New Roman\\""}],"entityRanges":[],"data":{"presetId":"text-body-1","listColor":"#666666","listType":"S_Bullets08","listSize":"100%","listIndent":"100%","listDepth":"0","overridden":"true"}}],"entityMap":{}}',
