text:'{"blocks":[{"key":"vluooj","text":"無口。致命的。そして、救われた存在。キャサンドラ・カインは、生まれたときから世界最強の暗殺者になるよう育てられ、言葉ではなく身体の動きを読み取り、ためらいなく殺すよう訓練されてきました。しかし、彼女は別の道を選び、バットガールとして新たな自分を見出します。並ぶ者のない武術の腕前と、消えることのない過去を背負いながら、キャサンドラは言葉ではなく行動で語り、ゴッサムを影から守ります。彼女はただの戦士ではありません——彼女は“やり直すチャンス”と、“自分自身の未来のために戦うこと”の象徴なのです。","type":"unstyled","depth":0,"inlineStyleRanges":[{"offset":0,"length":248,"style":"defaultBackgroundColor:#E8D01B"},{"offset":0,"length":248,"style":"textHighlightEnable:false"},{"offset":206,"length":2,"style":"fontFamily:Calibri"},{"offset":211,"length":1,"style":"fontFamily:Calibri"},{"offset":220,"length":1,"style":"fontFamily:Calibri"},{"offset":223,"length":1,"style":"fontFamily:Calibri"},{"offset":239,"length":1,"style":"fontFamily:Calibri"},{"offset":0,"length":248,"style":"textShadowEnable:false"},{"offset":0,"length":248,"style":"hlnk:"},{"offset":0,"length":248,"style":"overridden:true"},{"offset":0,"length":248,"style":"hlnkt:wp"},{"offset":0,"length":248,"style":"textOutlineEnable:false"},{"offset":0,"length":248,"style":"opacity:1"},{"offset":0,"length":248,"style":"hlnke:true"},{"offset":0,"length":248,"style":"backgroundColor:unset"},{"offset":0,"length":206,"style":"fontFamily:\\"MS Gothic\\""},{"offset":208,"length":3,"style":"fontFamily:\\"MS Gothic\\""},{"offset":212,"length":8,"style":"fontFamily:\\"MS Gothic\\""},{"offset":221,"length":2,"style":"fontFamily:\\"MS Gothic\\""},{"offset":224,"length":15,"style":"fontFamily:\\"MS Gothic\\""},{"offset":240,"length":8,"style":"fontFamily:\\"MS Gothic\\""}],"entityRanges":[],"data":{"presetId":"text-body-1","listColor":"#666666","listType":"S_Bullets08","listSize":"100%","listIndent":"100%","listDepth":"0","overridden":"true"}}],"entityMap":{}}',
